('2364','18','7889','Maria',Null,'Einfamilienhaus mit Natursteinfasade zu Verkaufen oder zu Mieten, Valdemossa','33284','Das Einfamilienhaus liegt in einer sehr ruhigen Wohnlage 3 km außerhalb von Valdemossa auf einem 1.000m  großen, flachen Grundstück. Die Villa bietet auf 260m² Wohnfläche, 4 Schlafzimmer, 3 Badezimmer, Wohn-Esszimmer mit offener moderner Küche, Hauswirtschaftsraum und deinen Kellerraum. Im angelegten Garten befindet sich noch ein Pool mit Liegeterrassen und Barbecue. Die Villa wird auch möbliert vermietet. Mindest Mietdauer 1 Jahr. Mietpreis liegt bei 4.000€ im Monat. Die Kaution bei 3 Monatsmieten. Die Maklergebühr wird bei Vermietung vom Mieter gezahlt und liegt bei 1,5 fachen der Monatsmiete','33285','965000','106','2015-08-19 14:45:44','106','2015-08-19 14:46:25',Null,'2448','130','1149',1,'1','0',Null,Null,Null,'33286',Null,'0','0','0',Null,'2015-08-19 14:50:37',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33287',Null,'33288',Null,'33289',Null,'33290',Null,'33291','0',0,'0');
